import React from 'react';

const FlipCard = (props) => {
    return (
        <div className="container">
            <div className="card-wrapper">
                <div className="front">
                    <div className="content">
                        {props.frontContent}
                    </div>
                </div>
                <div className="back">
                    <div className="content">
                        {props.backContent}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default FlipCard;
